window.addEventListener("DOMContentLoaded",(function(){headerActive(),playIframe()}));let headerActive=()=>{let e=document.querySelector(".header"),t=document.querySelector(".header__cross"),c=document.querySelector("body");e&&(t.onclick=()=>{e.classList.contains("active")?(e.classList.remove("active"),c.style.overflow=""):(e.classList.add("active"),c.style.overflow="hidden")})},playIframe=()=>{let e=document.querySelector(".iframe-block__content_wrapper"),t=document.querySelector(".iframe-block__content_wrapper>iframe");e.onclick=()=>{e.classList.add("active"),t.src+="?autoplay=1"}};